import React, { Fragment } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faQuoteLeft } from '@fortawesome/free-solid-svg-icons'
import { faQuoteRight } from '@fortawesome/free-solid-svg-icons'

import {
  Button, Card, CardBody
} from 'reactstrap';

const MainCard = () => (
  <Fragment>
    <Card className="w-80">
      <FontAwesomeIcon icon={faQuoteLeft} className="w-25 m-2" />
      <CardBody>
        <Button color="success" className="font-weight-bold float-right">Get New Quote</Button>
      </CardBody>
      <FontAwesomeIcon icon={faQuoteRight} className="w-25 ml-8" />
    </Card>

  </Fragment>
);

export default MainCard;
